import React from 'react';
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import CssBaseline from '@material-ui/core/CssBaseline';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    riddle: {
        borderBottom: `1px solid ${theme.palette.divider}`,
    },
    riddleHeader:{

        fontSize: '36px',
        textAlign: 'center',
    },
    riddleNumberOfCountries:{
        fontSize: '28px',
        textAlign: 'center',   
    }
}));

function Riddle() {
    const classes = useStyles();
    return (
    <React.Fragment>
		<div className={classes.riddle}>
            <Typography 
            className={classes.riddleHeader}>
            Name the 1 word countries countries that start and end<br></br>
            with a vowel but not the same vowel
            </Typography>

            <Typography 
            className={classes.riddleNumberOfCountries}>
            Number of Answers: 2
            </Typography>


		</div>
    </React.Fragment>
    );
}

export default Riddle
